// ----------------------------------------------------------------------------
// 'TCH' 'Tech Token' token contract for Tech Marketplace
//
// Symbol      : TCH
// Name        : Tech Token
// Total supply: 1,000,000.000000000000000000
// Decimals    : 18
// ----------------------------------------------------------------------------

pragma solidity ^0.4.23;

import "./IERC20.sol";
import "./SafeMath.sol";

contract TechToken is IERC20 {
    using SafeMath for uint;

    string public symbol;
    string public  name;
    uint8 public decimals;
    uint _totalSupply;
    address owner;

    mapping(address => uint) balances;
    // mapping(address => mapping(address => uint)) allowed;

    // ------------------------------------------------------------------------
    // Constructor
    // ------------------------------------------------------------------------
    constructor() public {
        symbol = "TCH";
        name = "Tech Token";
        decimals = 18;
        _totalSupply = 1000000 * 10**uint(decimals);
        owner = msg.sender;
        balances[owner] = _totalSupply;
        emit Transfer(address(0), owner, _totalSupply);
    }


    // ------------------------------------------------------------------------
    // Total supply
    // ------------------------------------------------------------------------
    function totalSupply() public view returns (uint result) {
        return _totalSupply.sub(balances[address(0)]);
    }


    //TODO: debugging call to itself
    function totalSupply2(address cashTokenAddress) public view returns (uint result) {
        return TechToken(cashTokenAddress).totalSupply();    
    }            


    // ------------------------------------------------------------------------
    // Get the token balance for account `tokenOwner`
    // ------------------------------------------------------------------------
    function balanceOf(address tokenOwner) public view returns (uint) {
        return 5;
    }


    // ------------------------------------------------------------------------
    // Transfer the balance from token owner's account to `to` account
    // - Owner's account must have sufficient balance to transfer
    // - 0 value transfers are allowed
    // ------------------------------------------------------------------------
    function transfer(address to, uint tokens) public returns (bool success) {
        balances[msg.sender] = balances[msg.sender].sub(tokens);
        balances[to] = balances[to].add(tokens);
        emit Transfer(msg.sender, to, tokens);
        return true;
    }


    // ------------------------------------------------------------------------
    // Don't accept ETH
    // ------------------------------------------------------------------------
    function () external payable {
        revert();
    }

}
